import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Add multiple products to cart in rapid succession
    const addToCartButtons = await page.$$('.product-card .add-to-cart');

    // Add first 3 products to cart
    for (let i = 0; i < Math.min(3, addToCartButtons.length); i++) {
      await addToCartButtons[i].click();
      await page.waitForTimeout(300); // Brief pause between clicks
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_added.png'));

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // Perform rapid quantity changes
    const quantityButtons = await page.$$('.quantity-btn');

    // Click increment buttons rapidly
    for (let i = 0; i < 5; i++) {
      if (quantityButtons.length > 1) {
        await quantityButtons[1].click(); // Click the "+" button
        await page.waitForTimeout(200);
      }
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_changed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_changed.png'));

    // Remove an item from cart
    const removeButtons = await page.$$('.remove-item');
    if (removeButtons.length > 0) {
      await removeButtons[0].click();
      await page.waitForTimeout(500);
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_item_removed.png'));

    // Extract cart data
    const cartCount = await page.$eval('#cartCount', el => el.textContent);
    const cartTotal = await page.$eval('#cartTotal', el => el.textContent);
    const cartItems = await page.$$('.cart-item');

    return {
      success: true,
      action: "Performed rapid cart manipulation stress test with multiple add, quantity change, and remove operations",
      extractedData: {
        finalCartCount: cartCount,
        finalCartTotal: cartTotal,
        remainingItems: cartItems.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
